// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// Copied largely from https://etherscan.io/address/0xe785e82358879f061bc3dcac6f0444462d4b5330#code#F1
contract TheFacesFund is ERC721, ERC721Enumerable, Ownable {

    using SafeMath for uint256;

    uint256 public maxSupply = 3000;
    uint256 private _price = 0.05 ether;
    uint256 private _reserved = 200;

    string public PROVENANCE = "";

    bool private _saleIsActive = false;
    string public baseURI;

    // TODO: set payout address
    // TODO: set constant
    address payoutAddress;

    constructor() ERC721("The Faces Fund", "TFF") {
        _saleIsActive = false;
    }

    modifier whenSaleStarted() {
        require(_saleIsActive, "Sale has not been started.");
        _;
    }

    function mint(uint256 _nbTokens) external payable whenSaleStarted {
        uint256 supply = totalSupply();
        require(_nbTokens < 21, "You cannot mint more than 20 Tokens at once!");
        require(supply + _nbTokens <= maxSupply - _reserved, "Not enough Tokens remain for transaction to complete.");
        require(_nbTokens * _price <= msg.value, "Insufficient amount sent!");

        for (uint256 i; i < _nbTokens; i++) {
            _safeMint(msg.sender, supply + i);
        }
    }

    function flipSaleState() external onlyOwner {
        _saleIsActive = !_saleIsActive;
    }

    function saleIsStarted() public view returns(bool) {
        return _saleIsActive;
    }

    function setBaseURI(string memory _URI) external onlyOwner {
        baseURI = _URI;
    }

    function _baseURI() internal view override(ERC721) returns(string memory) {
        return baseURI;
    }

    /* 
    Make it possible to change the maximum supply and reserved: for unit testing purposes only and is thus internal.
    */
    function setMaxSupplyAndReserved(uint256 _newMaxSupply, uint256 _newReserved) internal onlyOwner {
        require(_newMaxSupply >= _newReserved, "The max supply of tokens must exceed the number of reserved tokens.");
        maxSupply = _newMaxSupply;
        _reserved = _newReserved;
    }

    // Make it possible to change the price: just in case
    function setPrice(uint256 _newPrice) external onlyOwner {
        _price = _newPrice;
    }

    function getPrice() public view returns (uint256){
        return _price;
    }

    function getReservedLeft() public view returns (uint256) {
        return _reserved;
    }

    // This should be set before sales open.
    function setProvenanceHash(string memory provenanceHash) public onlyOwner {
        PROVENANCE = provenanceHash;
    }

    // Helper to list all the tokens in a wallet
    function walletOfOwner(address _owner) public view returns(uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);

        uint256[] memory tokensId = new uint256[](tokenCount);
        for(uint256 i; i < tokenCount; i++){
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokensId;
    }

    function claimReserved(uint256 _number, address _receiver) external onlyOwner {
        require(_number <= _reserved, "That would exceed the max reserved.");

        uint256 _tokenId = totalSupply();
        for (uint256 i; i < _number; i++) {
            _safeMint(_receiver, _tokenId + i);
        }

        _reserved = _reserved - _number;
    }

    function withdraw() public onlyOwner {
        uint256 _balance = address(this).balance;

        require(payable(payoutAddress).send(_balance));
    }

    // Necessary for compilation.
    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    // Necessary for compilation.
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
